var findTheDifference = function(s, t) {
  let map = {};
  let result = [];
  for (let item of s) {
    if(!map[item]) map[item] = 0;
      map[item]++; 
  }
  for (let item of t) {
    if(map[item]) map[item]--;
    else {
      map[item] = 1;
      result.push(item);
    };
  }

  return result.toString();
};
  
